css:
.source,
.atom-text-editor,
:host {
  background-color: #201f1f;
  color: #d4d2cf;
}
.source .wrap-guide,
.atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
.source .indent-guide,
.atom-text-editor .indent-guide,
:host .indent-guide {
  color: #394448;
}
.source .invisible-character,
.atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
.source .gutter,
.atom-text-editor .gutter,
:host .gutter {
  background-color: #282a2e;
  color: #c5c8c6;
}
.source .gutter .line-number.cursor-line,
.atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #c5c8c6;
}
.source .gutter .line-number.cursor-line-no-selection,
.atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
.source .gutter .line-number.folded,
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.source .gutter .line-number:after,
.atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
.source .fold-marker:after,
.atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
.source .invisible,
.atom-text-editor .invisible,
:host .invisible {
  color: #d4d2cf;
}
.source .cursor,
.atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
.source .selection .region,
.atom-text-editor .selection .region,
:host .selection .region {
  background-color: #404e51;
}
.atom-text-editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #678cb1;
}
.atom-text-editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #787775;
  font-style: italic;
}
.keyword {
  color: #78b753;
}
.keyword.other,
.keyword.control:not(.import) {
  color: #9c4013;
}
.keyword.operator {
  color: #ff9fec;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #508ed8;
}
.storage.modifier.reference,
.storage.type.class {
  color: #93c763;
}
.constant {
  color: #81a2be;
}
.constant.character.escape {
  color: #f3aba3;
}
.constant.other.placeholder {
  color: #e85848;
}
.constant.numeric {
  color: #c0a25f;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.constant.language {
  color: #c0a25f;
}
.variable {
  color: #508ed8;
}
.variable.interpolation {
  color: #2d74c8;
}
.variable.parameter.function {
  color: #d4d2cf;
}
.variable.other.dot-access {
  color: #d4d2cf;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #201f1f;
}
.string {
  color: #e85848;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #787775;
}
.punctuation.definition.string {
  color: #e85848;
}
.punctuation.definition.variable {
  color: #ff9fec;
}
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #d4d2cf;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #c00000;
}
.punctuation.section.embedded .source {
  color: #c00000;
}
.support.class {
  color: #d4d2cf;
}
.support.function {
  color: #a082bd;
}
.support.function.any-method {
  color: #d4d2cf;
}
.support.type {
  color: #508ed8;
}
.entity.name.function {
  color: #d4d2cf;
}
.entity.name.class,
.entity.name.type.class {
  color: #d4d2cf;
}
.entity.name.section {
  color: #d4d2cf;
}
.entity.name.tag {
  color: #a082bd;
}
.entity.name.type {
  color: #508ed8;
}
.entity.other.attribute-name {
  color: #b3b689;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.meta.class {
  color: #d4d2cf;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #d4d2cf;
}
.meta.preprocessor {
  color: #a082bd;
}
.none {
  color: #d4d2cf;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
.atom-text-editor[mini] .scroll-view {
  padding-left: 1px;
}
.php.type.function.php {
  color: #9c4013;
}
.php.other.keyword.use,
.php.other.phpdoc {
  color: #78b753;
}
